import {Outlet,Link} from "react-router-dom";
import {Navbar,Container,Nav,NavDropdown} from "react-bootstrap";

export default function (){
    return(
        <>
            <Navbar bg="dark" variant="dark">
                <Container>
                    <Navbar.Brand href="/">Register</Navbar.Brand>
                    <Nav className="me-auto">
                        <Nav.Link href="/members/new">New Registration</Nav.Link>
                        <Nav.Link href="/members">View Members</Nav.Link>
                        <NavDropdown title="Link">
                            <NavDropdown.Item href="/members/new">New Registration</NavDropdown.Item>
                            <NavDropdown.Item href="#action4">
                                Another action
                            </NavDropdown.Item>
                            <NavDropdown.Divider />
                            <NavDropdown.Item href="#action5">
                                Something else here
                            </NavDropdown.Item>
                        </NavDropdown>
                    </Nav>



                </Container>

            </Navbar>

            <Navbar bg="dark" variant="dark">
                <Container>
                    <Navbar.Brand href="/">Product</Navbar.Brand>
                    <Nav className="me-auto">
                        <Nav.Link href="/items/new">Create Product</Nav.Link>
                        <Nav.Link href="/items">Product List</Nav.Link>
                    </Nav>

                </Container>

            </Navbar>
            <Navbar bg="dark" variant="dark">
                <Container>
                    <Navbar.Brand href="/">Order</Navbar.Brand>
                    <Nav className="me-auto">
                        <Nav.Link href="/order">Order Product</Nav.Link>
                        <Nav.Link href="/orders">Your Order List</Nav.Link>
                    </Nav>

                </Container>

            </Navbar>
            <Outlet />

        </>
    )
}

